import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Auth from "./component/Auth/Auth";
import Home from "./component/Views/Home";
import UserProvider from "./component/Context/userProvider";
import Header from './component/Views/Home'
import Footer from './component/Views/Header'

function App() {
    return (
        <UserProvider>
                    <Header />
            <Router>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route
                        path="/login"
                        render={(props) => (
                            <Auth {...props} authRender="login" />
                        )}
                    />
                    <Route
                        path="/signup"
                        render={(props) => (
                            <Auth {...props} authRender="signup" />
                        )}
                    />
                </Switch>
            </Router>
                    <Footer />
        </UserProvider>
    );
}

export default App;
